import styled, {css} from 'styled-components';

const Container = styled.div`
    width: 100%;
    height: 848px;
    background-color: #f5f5f5;
`;
const Smartstore = () => {
    return(
        <div>
            SmartStore
        </div>
    )
}

export default Smartstore;
